import React, { Component } from "react";

class ProjectCard extends Component {
  state = {};
  render() {
    return (
      <div className="card">
        <img
          className="card-img bg-blur"
          src={this.props.image}
          alt="Project"
        />
        <div className="card-img-overlay">
          <h5 className="card-title bg-black text-light">{this.props.title}</h5>
          <p className="card-text">{this.props.text}</p>
          <p className="card-text">
            <code>{this.props.tags.join(", ")}</code>
          </p>
        </div>
        <div className="card-footer">
          <a href={this.props.link} class="btn btn-primary" target="_black">
            Visit on GitHub
          </a>
        </div>
      </div>
    );
  }
}

export default ProjectCard;
